// File: src/components/StageManagement.js
// Last Modified: 2026-03-29

import React from 'react';
import { TextField, Button, Typography, Card, CardContent, Box, TextareaAutosize, Grid } from '@mui/material';

function StageManagement({
    stageId, setStageId, stageName, setStageName, stageDescription, setStageDescription, stageType, setStageType,
    selectionTemplateId, setSelectionTemplateId, selectionCustomPrompt, setSelectionCustomPrompt,
    extractionTemplateId, setExtractionTemplateId, extractionCustomPrompt, setExtractionCustomPrompt,
    responseTemplateId, setResponseTemplateId, responseCustomPrompt, setResponseCustomPrompt,
    stageOutput, createStage, updateStage, fetchStages, handleEditStage, handleSnackbarOpen
}) {
    return (
        <Card sx={{ mt: 2 }}>
            <CardContent>
                <Typography variant="h6" gutterBottom>Stage Management</Typography>
                <Grid container spacing={2}>
                    <Grid item xs={12} md={6}>
                        <TextField fullWidth label="Stage ID (for editing)" variant="outlined" value={stageId} onChange={(e) => setStageId(e.target.value)} />
                    </Grid>
                    <Grid item xs={12} md={6}>
                        <Button variant="contained" onClick={handleEditStage}>Load Stage for Editing</Button>
                    </Grid>
                </Grid>
                <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, mt: 2 }}>
                    <TextField label="Stage Name" variant="outlined" value={stageName} onChange={(e) => setStageName(e.target.value)} />
                    <TextField label="Description" variant="outlined" value={stageDescription} onChange={(e) => setStageDescription(e.target.value)} />
                    <TextField label="Type" variant="outlined" value={stageType} onChange={(e) => setStageType(e.target.value)} />
                    <TextField label="Selection Template ID" variant="outlined" value={selectionTemplateId} onChange={(e) => setSelectionTemplateId(e.target.value)} />
                    <TextField label="Extraction Template ID" variant="outlined" value={extractionTemplateId} onChange={(e) => setExtractionTemplateId(e.target.value)} />
                    <TextField label="Response Template ID" variant="outlined" value={responseTemplateId} onChange={(e) => setResponseTemplateId(e.target.value)} />
                    <TextareaAutosize
                        minRows={3}
                        placeholder="Selection Custom Prompt"
                        style={{ width: 300, padding: 8 }}
                        value={selectionCustomPrompt}
                        onChange={(e) => setSelectionCustomPrompt(e.target.value)}
                    />
                    <TextareaAutosize
                        minRows={3}
                        placeholder="Extraction Custom Prompt"
                        style={{ width: 300, padding: 8 }}
                        value={extractionCustomPrompt}
                        onChange={(e) => setExtractionCustomPrompt(e.target.value)}
                    />
                    <TextareaAutosize
                        minRows={3}
                        placeholder="Response Custom Prompt"
                        style={{ width: 300, padding: 8 }}
                        value={responseCustomPrompt}
                        onChange={(e) => setResponseCustomPrompt(e.target.value)}
                    />
                    <Box sx={{ display: 'flex', gap: 2 }}>
                        <Button variant="contained" onClick={createStage}>Create Stage</Button>
                        <Button variant="contained" onClick={updateStage}>Update Stage</Button>
                        <Button variant="contained" onClick={fetchStages}>Fetch Stages</Button>
                    </Box>
                    <Typography variant="body1">{stageOutput}</Typography>
                </Box>
            </CardContent>
        </Card>
    );
}

export default StageManagement;
